export const Navbar = () => {
  return (
    <div className="wrapperNavbar">
      <div className="podrska">
        <img src="" alt="" className="podrskaImg" />
        <span className="podrskaTitle">Podr≈°ka</span>
      </div>
      <div className="Korisnik">
        <img src="" alt="img" className="KorisnikImg" />
        <span className="KorisnikTitle">Korisnik</span>
        <img src="\img\Path 696.svg" alt="svg" className="KorisnikSvg" />
      </div>
      <div className="navDashboard">
        <img src="" alt="img" className="navDashboardImg" />
        <span className="navDashboardTitle">Dashboard</span>
        <img src="" alt="svg" className="navDashboardSvg" />
      </div>
    </div>
  );
};
